import{BrowserRouter,Switch,Route} from "react-router-dom"
import Home  from "./booking/Home"
import Login from "./auth/Login"
import Register  from "./auth/Register"
function App() {
  return (
    <BrowserRouter >
    <Home />
    <Login />
    <Register />
    </BrowserRouter>
  );
}

export default App;
